import{_ as n,c as i,o,a2 as t}from"./chunks/framework.C9y-vmhh.js";const c=JSON.parse('{"title":"Contact","description":"","frontmatter":{},"headers":[],"relativePath":"tl/contact/index.md","filePath":"tl/contact/index.md","lastUpdated":1762807775000}'),s={name:"tl/contact/index.md"};function l(r,a,e,g,p,u){return o(),i("div",null,[...a[0]||(a[0]=[t('<h1 id="contact" tabindex="-1">Contact <a class="header-anchor" href="#contact" aria-label="Permalink to &quot;Contact&quot;">​</a></h1><p>Para sa propesyonal na konsultasyon o institutional collaborations na may kaugnayan sa kalusugan ng isip at relihiyosong praktis.</p><h2 id="impormasyon-sa-pakikipag-ugnayan" tabindex="-1">Impormasyon sa Pakikipag-ugnayan <a class="header-anchor" href="#impormasyon-sa-pakikipag-ugnayan" aria-label="Permalink to &quot;Impormasyon sa Pakikipag-ugnayan&quot;">​</a></h2><p><strong>Alejandro Parada</strong><br> Analyst Programmer | Espesyalista sa Kalidad at Seguridad ng Impormasyon<br> Mananaliksik sa AI na inilapat sa kalusugan ng isip</p><h3 id="mga-larangan-ng-espesyalisasyon" tabindex="-1">Mga Larangan ng Espesyalisasyon <a class="header-anchor" href="#mga-larangan-ng-espesyalisasyon" aria-label="Permalink to &quot;Mga Larangan ng Espesyalisasyon&quot;">​</a></h3><ul><li><strong>Pananaliksik sa Kalusugan ng Isip</strong>: Hindi pangkaraniwang pamamaraan ng <a href="https://inner-clarity.github.io/ClearPath/tl/prenc" target="_blank" rel="noreferrer">emotional regulation</a></li><li><strong>Psychological Analysis</strong>: Aplikasyon ng AI sa mga pattern ng kalusugan ng isip</li><li><strong>Computer Systems</strong>: Pagpapatupad ng mga tool para sa psychological well-being</li><li><strong>Organizational Psychology</strong>: Meyer-Briggs Type Indicator (MBTI), Emotional intelligence</li><li><strong>Psychology ng Impluwensya</strong>: Mga modelo ng persuasion at komunikasyon</li></ul><h2 id="mga-paraan-ng-pakikipag-ugnayan" tabindex="-1">Mga Paraan ng Pakikipag-ugnayan <a class="header-anchor" href="#mga-paraan-ng-pakikipag-ugnayan" aria-label="Permalink to &quot;Mga Paraan ng Pakikipag-ugnayan&quot;">​</a></h2><h3 id="github" tabindex="-1">GitHub <a class="header-anchor" href="#github" aria-label="Permalink to &quot;GitHub&quot;">​</a></h3><p>Para sa technical collaborations, bug reports o mga mungkahi para sa improvement:</p><p><strong>Repository:</strong> <a href="https://github.com/inner-clarity/InnerSight" target="_blank" rel="noreferrer">inner-clarity/InnerSight</a></p><h3 id="propesyonal-na-konsultasyon" tabindex="-1">Propesyonal na Konsultasyon <a class="header-anchor" href="#propesyonal-na-konsultasyon" aria-label="Permalink to &quot;Propesyonal na Konsultasyon&quot;">​</a></h3><p>Kung ikaw ay kumakatawan sa isang institusyon, organisasyon o may mga tanong sa pananaliksik na may kaugnayan sa:</p><ul><li><strong>Kalusugan ng isip at relihiyosong praktis</strong></li><li><strong>Development ng computer systems para sa psychological well-being</strong></li><li><strong>Pananaliksik sa <a href="https://inner-clarity.github.io/ClearPath/tl/prenc" target="_blank" rel="noreferrer">emotional regulation</a></strong></li><li><strong>Academic o institutional collaborations</strong></li></ul><h2 id="code-of-conduct" tabindex="-1">Code of Conduct <a class="header-anchor" href="#code-of-conduct" aria-label="Permalink to &quot;Code of Conduct&quot;">​</a></h2><p>Nagpapanatili kami ng propesyonal at respectful na environment. Ang lahat ng mga interaction ay dapat:</p><ul><li><strong>Propesyonal</strong> at batay sa ebidensya</li><li><strong>Respetuoso</strong> sa iba&#39;t ibang pananaw</li><li><strong>Constructive</strong> at nakatuon sa mga solusyon</li><li><strong>Confidential</strong> kung angkop</li><li><strong>Walang diskriminasyon</strong> at bias</li></ul><h2 id="mga-kontribusyon" tabindex="-1">Mga Kontribusyon <a class="header-anchor" href="#mga-kontribusyon" aria-label="Permalink to &quot;Mga Kontribusyon&quot;">​</a></h2><p>Kung interesado kang mag-ambag ng pananaliksik, academic content o technical improvements:</p><ol><li>Suriin ang documentation ng proyekto</li><li>Makipag-ugnayan upang talakayin ang iyong proposal</li><li>Magtulungan sa pagsunod sa mga establisheng propesyonal na pamantayan</li></ol><div class="tip custom-block"><p class="custom-block-title">Propesyonal na Konsultasyon</p><p>Ang espasyong ito ay dinisenyo upang magtaguyod ng informed dialogue sa pagitan ng propesyonal na clinical perspectives at ecclesiastical leadership.</p></div><hr><p><em>&quot;Ang paglilingkod ay ang dalisay na pag-ibig ni Cristo, at ito ay nananatili magpakailanman; at sinuman ang makitagpuang taglay nito sa huling araw, magiging mabuti ang kaniyang kapalaran.&quot; - Moroni 7:47</em></p><p><em>Huling update: Setyembre 2025</em></p><hr><div class="tip custom-block"><p class="custom-block-title">Maligayang pagdating!</p><p>Tala: Ang InnerSight ay isang independiyenteng mapagkukunan ng edukasyon, na nilikha ng mga tapat na miyembro para suportahan ang mga lider, pamilya, at propesyonal. Ito ay hindi nauugnay o opisyal na sinusuportahan ng Ang Simbahan ni Jesucristo ng mga Banal sa mga Huling Araw.</p><p>Ang bawat panloob na paglalakbay ay nagsisimula sa isang unang hakbang. Ang sa iyo ay nagsisimula dito.</p></div>',25)])])}const m=n(s,[["render",l]]);export{c as __pageData,m as default};
